import React from 'react';
import Typed from 'react-typed';

const Hero = () => {
  return (
    <div className='text-white h-screen flex flex-col justify-center items-center'>
      <p className='text-[#00df9a] font-bold p-2'>GROWING WITH DATA ANALYTICS</p>
      <h1 className='md:text-5xl sm:text-3xl text-2xl font-bold md:py-6'>Grow With Data.</h1>
      <div className='flex justify-center items-center'>
        <p className='md:text-3xl sm:text-2xl text-xl font-bold'>fast, flexible financing for</p>
        <Typed 
          className='md:text-3xl sm:text-2xl text-xl font-bold pl-2'
          strings={['BTB', 'BTC', 'SASS']} 
          Typespeed={120} 
          backspeed={140} loop
        />
      </div>
    </div>
  );
};

export default Hero;
